export default function Cards({onCardClick, link, name, likes}) {
    function handleClick() {
        onCardClick(props.link, props.name);
      }  
    return(     
        
        
        <div className="card" id="card" >
  <button
    className="card__delete"
    type="button"
    id="delete_card"
    aria-label="удаление карты"
  />
  <img
    className="card__image"
    alt="#"
    data-modal-btn="popup_increase-image"
    src={props.link}
    onClick={handleClick}
  />
  <div className="card__info">
    <h2 className="card__name"> {props.name} </h2>
    <div className="card__like-block">
      <button className="card__like" type="button" id="cardlike" ></button>
       <span className="card__number-likes"> {props.likes.length}</span>
      
    </div>
  </div>
</div>

        

    )
}
